def maximize_sweets(n, s, sugar_prices):
    s /= 100
    max_sweets = -1
    for (x, y) in sugar_prices:
        total_cost = x * 100 + y
        if total_cost <= s:
            max_sweets = max((100 - y) % 100, max_sweets)
    return max_sweets

